import styled from "styled-components"
import { Link } from "react-router-dom"

const Links = () => {
  return (
    <Background>
      <Link to="/intro">
        <LinkItem>첫번째</LinkItem>
      </Link>
      <Link to="/how-to-feed">
        <LinkItem>두번째</LinkItem>
      </Link>
      <Link to="/closeness">
        <LinkItem>세번째</LinkItem>
      </Link>
    </Background>
  )
}

export default Links

const Background = styled.div`
  display: flex;
  height: 25vh;
  width: 70%;
  background: white;
`

const LinkItem = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 20vw;
  height: 100%;
  background: white;
  cursor: potiner;
  &:hover {
    filter: brightness(80%);
  }
  color: black;
`
